        return new Source("{% extends 'layout.html.twig' %}
{% block title %}
    {{ 'Reset lozinke - Prodaja autoprikolica, traktora.'|trans }} | prikolica.shop
{% endblock title %}
{% block metatags %}
    {{ parent() }}
    {#    <meta name=\"description\" content=\"{{ metaData.pageMetaDescription }}\"/>#}
    {#    <meta name=\"keywords\" content=\"{{ metaData.pageMetaKeywords }}\"/>#}
    <meta name=\"description\" content=\"Distribucija i prodaja autoprikolica i traktora.\">
    <meta name=\"keywords\" content=\"autoprikolice, prikolice, traktori, prodaja, cena, trigano, arilje\">
    <meta name=\"robots\" content=\"index, follow\">
    <link rel=\"canonical\" href=\"{{ app.request.uri }}\" />
{% endblock metatags %}

{% block content %}
    <!-- header  -->
    {% include 'include/header.html.twig' %}
    <!-- mobile fix menu -->
    {% include 'include/mobile_menu.html.twig' %}
    <!-- home slider -->
    <!-- Log In Section Start -->
    <div class=\"login-section\">
        <div class=\"materialContainer\">
            <div class=\"box\">
                <div class=\"login-title\">
                    <h3>Uspešno ste resetovali lozinku</h3>
                </div>
                {% block body %}
                    {% for flash_error in app.flashes('reset_password_error') %}
                        <div class=\"alert alert-danger\" role=\"alert\">{{ flash_error }}</div>
                    {% endfor %}
                    {{ form_start(resetForm) }}
                    <div class=\"input\">
                        {{ form_widget(resetForm.plainPassword.first, {'attr': {'id': 'email'}}) }}
                        <span class=\"spin\"></span>
                    </div>

                    <div class=\"input\">
                        {{ form_widget(resetForm.plainPassword.second, {'attr': {'id': 'email'}}) }}
                        <span class=\"spin\"></span>
                    </div>
                    <div class=\"button login\">
                        <button type=\"submit\">
                            <span>Resetujte</span>
                            <i class=\"fa fa-check\"></i>
                        </button>
                    </div>
                    {{ form_end(resetForm) }}
                {% endblock %}
            </div>
        </div>
    </div>
    <!-- Log In Section End -->

    <!-- footer start -->
    {% include 'include/footer.html.twig' %}
    <!-- footer end -->

    <!-- Newsletter modal start -->
    {#    {% include 'include/newsletter.html.twig' %}#}
    <!-- Newsletter modal end -->

    <!-- Coockie Section Start -->
    {#    {% include 'include/cookie.html.twig' %}#}
    <!-- Coockie Section End -->

    <!-- theme Setting Start -->
    {#    <div class=\"theme-setting\">#}
    {#        <ul>#}
